# --------------------------
# 日志配置（优化输出格式）
# --------------------------
logging.basicConfig(
    level=logging.INFO,
    format="%(asctime)s.%(msecs)03d | %(levelname)-8s | %(message)s",
    datefmt="%H:%M:%S"
)
logger = logging.getLogger("WSDebug")


# --------------------------
# 核心调试类（完全类型注解）
# --------------------------
class WebSocketDebugger:
    def __init__(self, config: DebugConfig) -> None:
        self.cfg = config
        self.uri = f"{'wss' if self.cfg.USE_SSL else 'ws'}://{self.cfg.HOST}:{self.cfg.PORT}{self.cfg.PATH}"
        print(self.uri)

    async def _connect(self) -> WebSocketClientProtocol:
        """安全建立WebSocket连接"""
        try:
            return await connect(
                self.uri,
                ping_interval=None,
                close_timeout=self.cfg.TIMEOUT,
                logger=logger if self.cfg.LOG_VERBOSE else None,
                extra_headers=self.cfg.HEADERS
                # additional_headers = self.cfg.HEADERS,
            )
        except Exception as e:
            logger.error(f"Connection failed: {e!r}")
            raise

    async def _test_message_cycle(self, message: str|list[bytes]) -> None:
        """测试完整消息生命周期"""
        ws: Optional[WebSocketClientProtocol] = None
        try:
            # 建立连接
            ws = await self._connect()
            # 发送消息
            send_ts = datetime.now().timestamp()
            if isinstance(message,str):
                await ws.send(message.encode('utf-8'))
            elif isinstance(message,bytes):
                data = opus_encoder.encode(message, AudioConfig.FRAME_SIZE)
                await ws.send(data)
            elif isinstance(message,list):
                start_index = 0
                while True:
                    try:
                        if len(message)  > start_index:
                            _message = message[start_index]
                            data = opus_encoder.encode(_message, AudioConfig.FRAME_SIZE)
                            await ws.send(data)
                        else:
                            data = b''
                            await ws.send(data)
                        if isinstance(_message,str):
                            logger.info(f"▶ Sent: {_message}")
                        elif isinstance(_message,bytes):
                            logger.info(f"▶ Sent: {len(_message)} bytes")
                        try:
                            # 接收响应
                            response = await asyncio.wait_for(ws.recv(), self.cfg.TIMEOUT)
                            # 计算延迟
                            if isinstance(response,str):
                                logger.info(f"◀ Received (ms): {response}")
                            elif isinstance(response,bytes):
                                logger.info(f"◀ Received (ms): {len(response)} types")
                        except TimeoutError as e:
                            logger.info(f"◀ Received (ms): {traceback.print_exc()} types")
                            break
                    except Exception as e:
                        pass
                    start_index += 1
        except asyncio.TimeoutError:
            logger.error("⌛ Response timeout")
        except websockets.ConnectionClosed as e:
            logger.error(f"🔌 Connection closed: code={e.code}, reason={e.reason!r}")
        except Exception as e:
            logger.error(f"💥 Unexpected error: {e!r}", exc_info=self.cfg.LOG_VERBOSE)
        finally:
            if ws and not ws.closed:
                await ws.close()


    async def run(self) -> None:
        """执行完整测试套件"""
        logger.info("=" * 60)
        logger.info(f"🔧 Starting WebSocket debug session: {self.uri}")
        logger.info("=" * 60)

        # 基础功能测试
        logger.info("\n📩 Basic message testing")
        # for msg in self.cfg.TEST_MESSAGES:
        #     await self._test_message_cycle(msg)

        await self._test_message_cycle(self.cfg.TEST_MESSAGES)


        logger.info("=" * 60)
        logger.info("🏁 All tests completed")
        logger.info("=" * 60)


# --------------------------
# 主入口（最佳实践）
# --------------------------
async def main() -> None:
    debugger = WebSocketDebugger(DebugConfig())
    try:
        await debugger.run()
    except KeyboardInterrupt:
        logger.info("🛑 Debug session interrupted")


if __name__ == "__main__":
    asyncio.run(main())